export default function TableResponse({ tableData }) {
  return (
    <table className="w-full border border-gray-400 mt-3">
      <thead>
        <tr>
          {Object.keys(tableData[0]).map((key) => (
            <th
              key={key}
              className="border bg-gray-200 dark:bg-gray-700 p-2"
            >
              {key.toUpperCase()}
            </th>
          ))}
        </tr>
      </thead>

      <tbody>
        {tableData.map((row, i) => (
          <tr key={i}>
            {Object.values(row).map((val, j) => (
              <td key={j} className="border p-2">
                {val}
              </td>
            ))}
          </tr>
        ))}
      </tbody>
    </table>
  );
}
